The  Layout  type is defined as  type  Layout { T <: Associative { Symbol , Any }}   <:   AbstractLayout 
     fields :: T  end   You can construct a layout using the same convenient keyword argument syntax
that we used for traces:  julia>   l   =   Layout (; title = "Penguins" ,                     xaxis_range=[0, 42.0], xaxis_title="fish",                     yaxis_title="Weight",                     xaxis_showgrid=true, yaxis_showgrid=true,                     legend_y=1.15, legend_x=0.7)  layout with fields legend, margin, title, xaxis, and yaxis  julia>   println ( JSON . json ( l ,   2 ))  {    "yaxis": {      "title": "Weight",      "showgrid": true    },    "legend": {      "y": 1.15,      "x": 0.7    },    "xaxis": {      "range": [      ],      "title": "fish",      "showgrid": true    },    "title": "Penguins",    "margin": {      "r": 50,      "l": 50,      "b": 50,      "t": 60    }  }

Recall that the definition of the  Plot  object is  type  Plot { TT <: AbstractTrace } 
     data :: Vector { TT } 
     layout :: AbstractLayout 
     divid :: Base . Random . UUID  end   Given one or more  AbstractTrace s and optionally a  layout , we construct a Plot  object with any of the following constructors  # A blank canvas no traces or a layout  Plot ()  # A vector of traces and a layout  Plot { T <: AbstractTrace }( data :: Vector { T },   layout :: AbstractLayout )  # A vector of traces -- default layout supplied  Plot { T <: AbstractTrace }( data :: Vector { T })  # a single trace: will be put into a vector -- default layout supplied  Plot ( data :: AbstractTrace )  # a single trace and a layout (trace put into a vector)  Plot ( data :: AbstractTrace ,   layout :: AbstractLayout )   Notice that none of the recommended constructors have you pass the  divid 
field manually. This is an internal field used to allow the display and
unique identification of multiple plots in a single web page.
